import React from "react";
import classes from "./dropDownMenu.module.scss";

const DropDownMenu = ({ dropDown, dropDownContent }) => {
  const rootClasses = [classes.dropDown];
  if (dropDown) {
    rootClasses.push(classes.active);
  }

  return (
    <div className={rootClasses.join(" ")}>
      {dropDownContent.map((group) => (
        <h4 key={`droptitle${group}`}>{Object.keys(group)}</h4>
      ))}
      <ul>
        {dropDownContent.map((group) => {
          for (let key in group) {
            group[key].map((item) => <li>{item}</li>);
          }
        })}
      </ul>
    </div>
  );
};

export default DropDownMenu;
